export const COLUMNS = [
  {
    Header: "Common Name",
    accessor: "comName",
    Cell: (props) => {
      return <div sci={props.sci}>{props.cell.value}</div>;
    },
  },
  {
    Header: "Scientific Name",
    accessor: "sciName",
    Cell: (props) => {
      return <td sci={props.sci}>{props.cell.value}</td>;
    },
  },
  {
    Header: "Location",
    accessor: "locName",
    Cell: (props) => {
      return <td sci={props.sci}>{props.cell.value}</td>;
    },
  },
  {
    Header: "Date",
    accessor: "obsDt",
    Cell: (props) => {
      return <td sci={props.sci}>{props.cell.value}</td>;
    },
  },
];
